import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import './Home.css'

class Home extends Component {

    render() {
        return (
            <>
                <aside>
                    <h1>THE</h1>
                </aside>
                <main>
                    <h1>UNDERGROUND</h1>
                    <Link to='/signup'>Join</Link>
                    <Link to='/login'>Login</Link>
                </main>
            </>
        )
    }
}

export default Home
